description:
Full Auto 2: Battlelines puts high-speed vehicles outfitted with weapons and armor into fully realized and fully destructible urban street environments. 

Players can destroy the environment to dynamically change track conditions to block competitors, open new paths, or crush opponents with falling debris caused by well-timed missiles. 

Full Auto 2: Battlelines for the PSP features exclusive content including a new 56 event single-player story mode, and a host of new weapons guaranteed to cause massive destruction and havok. 

This is a pretty fast paced game that emulates perfectly.

Extract with WinRAR or 7zip.



